import React, { useEffect, useState } from 'react';
import axios from 'axios';

export default function CustomersList() {
  const [customers, setCustomers] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8000/api/customers')
      .then(response => setCustomers(response.data))
      .catch(error => console.error('Błąd ładowania danych:', error));
  }, []);

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-4xl font-extrabold mb-8 text-center text-indigo-700 drop-shadow-lg">
        Sklep Internetowy - Frontend
      </h1>
      
      <div className="bg-white rounded-2xl shadow-lg p-6 overflow-x-auto">
        <table className="min-w-full border-collapse">
          <thead>
            <tr className="bg-gradient-to-r from-indigo-500 to-indigo-600 text-white text-lg">
              <th className="p-3 text-left">ID</th>
              <th className="p-3 text-left">Imię</th>
              <th className="p-3 text-left">Nazwisko</th>
              <th className="p-3 text-left">Miasto</th>
              <th className="p-3 text-left">Ulica</th>
              <th className="p-3 text-left">Email</th>
            </tr>
          </thead>
          <tbody>
            {customers.map(customer => (
              <tr key={customer.id} className="hover:bg-indigo-100 transition-colors">
                <td className="p-3">{customer.id}</td>
                <td className="p-3">{customer.imie}</td>
                <td className="p-3">{customer.nazwisko}</td>
                <td className="p-3">{customer.miasto}</td>
                <td className="p-3">{customer.ulica}</td>
                <td className="p-3">{customer.email}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
